- {couple}, đôi, cặp, đôi vợ chồng; cặp nam nữ (đã lấy nhau hoặc đã đính hôn); cặp nam nữ nhảy quốc tế, dây xích cặp (buộc liền một cặp chó săn), cặp chó săn, (cơ khí) ngẫu lực, (điện học) cặp, không lúc nào rời nhau, lúc nào cũng cặp kè bên nhau, buộc thành cặp, ghép thành cặp, kết đôi, nối hợp lại, ghép lại, cho cưới, cho lấy nhau, gắn liền, liên tưởng, (điện học) mắc, nối, lấy nhau, cưới nhau (người), giao cấu (loài vật)
- {brace}, vật (để) nối, (kiến trúc) trụ chống, thanh giằng, đôi, (số nhiều) dây đeo quần, dây brơten; dây căng trống, (kỹ thuật) cái khoan quay tay; cái vặn ốc quay tay ((cũng) brace and bit), (ngành in) dấu ngoặc ôm, (hàng hải) dây lèo, móc, chằng, nối cho vững; làm chắc thêm, (kiến trúc) chống bằng trụ chống, đóng thanh giằng, căng (trống), kết đôi, cặp đôi, (ngành in) đặt trong dấu ngoặc ôm, (hàng hải) quay hướng (buồm) bằng dây lèo, gắng (hết sức mình), dốc (hết nghị lực...), làm mạnh thêm, làm cường tráng, khuyến khích, khích lệ
- {いちばん}
- {best}, tốt nhất, hay nhất, đẹp nhất, giỏi nhất, đại bộ phận, đi thật nhanh, đi ba chân bốn cẳng, (nghĩa bóng) làm công việc mình thành thạo nhất, tốt nhất, hay nhất; hơn nhất, tốt nhất là, khôn hơn hết là, cái tốt nhất, cái hay nhất, cái đẹp nhất, cố gắng lớn nhất, quần áo đẹp nhất, trong điều kiện tốt nhất, trong hoàn cảnh tốt nhất, không có triển vọng gì hay, không hy vọng gì có chuyện tốt đẹp xảy ra, lúc đẹp nhất, lúc tốt nhất, lúc sung sức nhất, lúc rực rỡ nhất, (tục ngữ) cầu toàn thường khi lại hỏng việc, làm hết sức mình, thắng thế (trong khi tranh luận...), (thể dục,thể thao) thắng ai, (tục ngữ) không có cá thì lấy rau má làm ngon, (xem) Sunday, mặc dầu có khó khăn vẫn vui vẻ cố gắng; không nản lòng trong lúc khó khăn, tận dụng cái hay, cái tốt đẹp của việc gì, chịu đựng cái gì, tranh thủ thời gian, đi thật nhanh, gửi lời chào, gửi lời chúc mừng, với tất cả sự hiểu biết của mình, với tất cả khả năng của mình, như bất cứ ai, hơn, thắng (ai); ranh ma hơn, láu cá hơn (ai)
- {first}, thứ nhất, đầu tiên; quan trọng nhất; cơ bản, trực tiếp, từ ban đầu, từ cái nhìn ban đầu, thoạt nhìn ((cũng) at first view), thoạt nhìn, (xem) blush, mới đầu, sang số 1, (thông tục) làm việc gì trước tiên, ngã lộn đầu xuống, trước tiên, trước hết, trước, đầu tiên, lần đầu, thà, đầu tiên và trước hết, nói chung, (xem) come, trước hết, (từ Mỹ,nghĩa Mỹ) trước hết, chẳng chóng thì chày, người đầu tiên, người thứ nhất; vật đầu tiên, vật thứ nhất, ngày mùng một, buổi đầu, lúc đầu, (số nhiều) hàng loại đặc biệt (bơ, bột), (từ Mỹ,nghĩa Mỹ),  (kỹ thuật) số một (máy nổ...), ngày mồng một tháng chín (mở đầu mùa săn gà gô)
