- {game}, trò chơi (như bóng đá, quần vợt, bài lá...), (thương nghiệp) dụng cụ để chơi (các trò chơi), (số nhiều) cuộc thi điền kinh, cuộc thi đấu, ván (bài, cờ...), trò cười; chuyện nực cười, trò đùa; sự trêu chọc, sự chế nhạo; trò láu cá, mánh khoé, ý đồ, mưu đồ, thú săn; thịt thú săn, (từ Mỹ,nghĩa Mỹ),  (từ lóng) mục tiêu theo đuổi khó khăn, mục tiêu nguy hiểm, con vật bị săn, con vật bị dồn; người bị theo đuổi, vật bị theo đuổi, bầy (thiên nga), (thể dục,thể thao) không sung sức, (thể dục,thể thao) sung sức, có những tham vọng cao hơn, nắm chắc thắng lợi trong tay; làm chủ được cuộc đấu, (xem) play, anh thắng cuộc, việc làm lợi chẳng bõ công; thu không bù chi, việc làm đã thất bại, đánh bạc, thua bạc khánh kiệt, như gà chọi; dũng cảm, anh dũng, gan dạ, có nghị lực, bị bại liệt (chân, tay); què, thọt
- {round}, tròn, tròn, chẵn, (từ Mỹ,nghĩa Mỹ) khứ hồi, theo vòng tròn, vòng quanh, thẳng thắn, chân thật, nói không úp mở, sang sảng, vang (giọng), lưu loát, trôi chảy (văn), nhanh, mạnh, khá lớn, đáng kể, vật hình tròn, khoanh, vòng tròn, vòng, sự quay, vòng, sự tuần hoàn, chu kỳ, (nghĩa bóng) phạm vi, lĩnh vực, sự đi vòng, sự đi tua; cuộc kinh lý, cuộc đi dạo; (số nhiều) (quân sự) cuộc tuần tra, tuần chầu (mời rượu...), (thể dục,thể thao) hiệp (quyền Anh); vòng thi đấu (quần vợt...); (đánh bài) hội, tràng, loạt, thanh thang (thanh ngang tròn của cái thang) ((cũng) round of a ladder), (quân sự) phát (súng); viên đạn, (âm nhạc) canông, nêu rõ tất cả những đường nét của một cái gì; nêu bật vấn đề gì, quanh, vòng quanh, loanh quanh; xung quanh, tròn, trở lại, quay trở lại, khắp cả, thuyết phục được ai theo ý kiến mình, quanh, xung quanh, vòng quanh, làm tròn, cắt tròn, cắt cụt, đi vòng quanh mũi đất, ((thường) + off) gọt giũa (một câu), đọc tròn môi, ((thường) + off) làm giàu thêm lên (của cải, tài sản...), thành tròn, trở nên tròn, làm tròn; làm cho trọn vẹn; làm cho cân đối, gọt giũa (câu văn), xây dựng thành cơ ngơi, (từ hiếm,nghĩa hiếm) quay lại, bất ngờ đối đáp lại (ai), bất ngờ vặn lại (ai), bất ngờ tấn công lại (ai), (thông tục) làm chỉ điểm, tâu hót, tố giác, tròn ra, mập ra, béo ra, (hàng hải) lái theo chiều gió, chạy vòng quanh để dồn (súc vật), vây bắt, bố ráp
- {bout}, lần, lượt, đợi, cơn (bệnh); chầu (rượu), cuộc vật lộn, cuộc chiến đấu; cuộc đọ sức, nhân dịp này
- {fall}, sự rơi, sự ngã; sự rụng xuống (lá); sự rũ xuống; sự hạ, sự sụp đổ, sự suy sụp (của một đế quốc...); sự sa sút, sự mất địa vị, sự xuống thế, sự xuống dốc (của một người...), sự sụt giá, sự giảm giá, (thể dục,thể thao) sự vật ngã; keo vật, sự sa ngã (đàn bà), lượng mưa, lượng tuyết, số lượng cây ngả; số lượng gỗ xẻ, hướng đi xuống; dốc xuống, (số nhiều) thác, sự đẻ (của cừu); lứa cừu con, dây ròng rọc, lưới che mặt, mạng che mặt (của phụ nữ), (từ Mỹ,nghĩa Mỹ) mùa lá rụng, mùa thu, lúc chập tối, lúc màn đêm buông xuống, (tục ngữ) trèo cao ngã đau, (xem) ride, rơi, rơi xuống, rơi vào ((nghĩa đen) & (nghĩa bóng)), rủ xuống, xoã xuống (tóc...); rụng xuống (lá); ngã, hạ thấp, xuống thấp, xịu xuống; dịu đi, nguôi đi, đổ nát, sụp đổ, mất địa vị, bị hạ bệ, xuống thế, sa sút, xuống dốc, sa ngã (đàn bà), thất bại, thất thủ, hy sinh, chết, ngã xuống ((nghĩa bóng)), buột nói ra, thốt ra, sinh ra, đẻ ra (cừu con...), (+ into) được chia thành thuộc về, bị (rơi vào tình trạng nào đó...), dốc xuống, đổ ra, bắt đầu, xông vào, (tiếng địa phương); (từ Mỹ,nghĩa Mỹ) chặt, hạ (cây), tình cờ gặp (ai), tình cờ rơi vào đám (người nào...), bỏ, rời bỏ, bỏ rơi (ai...); ly khai (đạo, đảng), héo mòn đi, gầy mòn đi, biến đi, ngã ngửa, rút lui, phải cầu đến, phải dùng đến (cái gì), thụt lùi, bị tụt lại đằng sau, (từ Mỹ,nghĩa Mỹ) không trả được đúng hạn, còn thiếu lại, còn nợ lại, rơi xuống, ngã xuống, sụp xuống, sụp đổ, (từ lóng) mê tít, phục lăn, mỹ bị bịp, bị chơi xỏ, (quân sự) đứng vào hàng, (thông tục) vào trong lùi vào trong (ngôi nhà), đến lúc phải thanh toán (nợ); hết hạn (hợp đồng thuê nhà), sập, lún, sụp đổ (mái nhà...), tình cờ gặp (ai), theo, tán đồng (quan điểm của ai...); đồng ý với (ai); (từ Mỹ,nghĩa Mỹ) chiều ý, theo ý (ai), trùng hợp với, rơi xuống, rút, giảm sút; thoái hoá, tàn tạ, suy đồi, (hàng hải) không ăn theo tay lái, nổi dậy, bỏ hàng ngũ, nhập trận, tấn công, bắt đầu ăn uống, rơi ra ngoài; xoã ra (tóc), cãi nhau, bất hoà, hoá ra là, thành ra là, dẫn đến kết quả là, 